// import logo from "./logo.svg";
import "./App.css";
import ToDoContainer from "./containers/ToDo";
import Routes from "./routes";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          {Routes.map((ROUTE_INFO, idx) => {
            return <Route {...ROUTE_INFO} key={idx} />;
          })}
          <Redirect path="*" to="/404" />
        </Switch>
